import './Navbar.css';
import {useState} from 'react';
import {BrowserRouter as Router, Route} from 'react-router-dom';


const Navbar = () => {
    const [username, setUsername] = useState ('Trisha');
    return (
        <nav id='navbar'>
        <ul>
          <Route path="/"><a href="#"><li>Home</li></a></Route>
          <Route path="/contact"><a href="#"><li>Contact</li></a></Route>
          <Route path="/about"><a href="#"><li>About</li></a></Route>
        </ul>
        <div className="nav-details">
          <p className="nav-username"> {username} </p>
        </div>
        </nav>
    )
}
export default Navbar;
